import React from 'react';
import Text from "./Text";
import {StyleSheet, css} from 'aphrodite';
const Header = () => {
    const containerRowStyle = StyleSheet.create({
      row: {
          "display":"flex",
          flexDirection:"row",
          alignItems: "start"
      },
        spaceWidth: {
          marginLeft: "1.5%",
            marginRight : "1.5%"
        }
    });
    return (
        <div className={css(containerRowStyle.row)}>
            <Text text="new text" color="red" fontWeight="600"></Text>
            <span className={css(containerRowStyle.spaceWidth)}></span>
            <span className={css(containerRowStyle.spaceWidth)}></span>
            <Text text="new text" color="red" fontWeight="600"></Text>
            <span className={css(containerRowStyle.spaceWidth)}></span>
            <Text text="new text" color="red" fontWeight="600"></Text>
            <span className={css(containerRowStyle.spaceWidth)}></span>
            <Text text="new text" color="red" fontWeight="600"></Text>
            <span className={css(containerRowStyle.spaceWidth)}></span>
            <Text text="new text" color="red" fontWeight="600"></Text>

        </div>
    );
};

export default Header;
